	Where r.id = Gv_id_reservation;
	
	

	-- Se valida que se hayan recuperado datos 
	if ( ln_total_days is not null And ld_date_init is not null And ln_amount is not null ) then
	-- Elimina los registros que hayan
	Delete From reservations_deta Where	id_reservation = Gv_id_reservation;		

	-- Loop inserta deta de reservations
		loop_reservations_deta: loop
			-- Se termina cuando el contador sea igua a los das
			if ( ln_counter >= ln_total_days ) then
				LEAVE loop_reservations_deta;
			end if;
	
		    -- Inserta el registro
			Insert Into reservations_deta (
				id_reservation,
				apply_date,
				amount
			) Values (
				Gv_id_reservation,
				DATE_ADD(ld_date_init, INTERVAL (ln_counter) DAY),
				ln_amount
			);
	
			
			Set ln_counter = ln_counter +1;
	
		end loop loop_reservations_deta;
	end if;
	
END ;;
