CREATE DEFINER=`admin`@`%` PROCEDURE `p_get_data_reservation`(
in date1 date,
in date2 date,
in id_category varchar(100),
out total_days int,
out total_amount DOUBLE)
BEGIN
	DECLARE amount_day DOUBLE DEFAULT 0;

	Select price
	Into amount_day
	From suites_categories sc 
	Where sc.id = id_category ;
	
	set total_days = f_diferences_between_dates( date1 , date2 );
	set	total_amount = amount_day * total_days;

END ;;
